import React, { useState } from 'react';
import { 
  Grid, 
  Card, 
  CardContent, 
  CardMedia, 
  Typography, 
  Button, 
  Box,
  Tabs,
  Tab,
  Chip,
  Stack,
} from '@mui/material';
import { Link } from 'react-router-dom';

// 角色分类
const categories = [
  { id: 'all', label: '全部' },
  { id: 'celebrity', label: '名人' },
  { id: 'scientist', label: '科学家' },
  { id: 'artist', label: '艺术家' },
  { id: 'philosopher', label: '哲学家' },
  { id: 'anime', label: '动漫角色' },
  { id: 'game', label: '游戏角色' },
];

const characters = [
  {
    id: 1,
    name: '埃隆·马斯克',
    description: '特斯拉和SpaceX的CEO',
    avatar: 'https://via.placeholder.com/150',
    tags: ['企业家', '科技', '创新'],
    category: 'celebrity',
  },
  {
    id: 2,
    name: '爱因斯坦',
    description: '著名物理学家',
    avatar: 'https://via.placeholder.com/150',
    tags: ['科学家', '物理学', '相对论'],
    category: 'scientist',
  },
  {
    id: 3,
    name: '莎士比亚',
    description: '伟大的戏剧家和诗人',
    avatar: 'https://via.placeholder.com/150',
    tags: ['文学', '戏剧', '诗歌'],
    category: 'artist',
  },
  {
    id: 4,
    name: '苏格拉底',
    description: '古希腊哲学家',
    avatar: 'https://via.placeholder.com/150',
    tags: ['哲学', '教育', '智慧'],
    category: 'philosopher',
  },
  {
    id: 5,
    name: '路飞',
    description: '海贼王主角',
    avatar: 'https://via.placeholder.com/150',
    tags: ['冒险', '热血', '友情'],
    category: 'anime',
  },
];

const Home = () => {
  const [selectedCategory, setSelectedCategory] = useState('all');
  const [selectedTags, setSelectedTags] = useState<string[]>([]);

  // 获取所有标签
  const allTags = Array.from(
    new Set(characters.flatMap(char => char.tags))
  );

  // 处理分类切换
  const handleCategoryChange = (event: React.SyntheticEvent, newValue: string) => {
    setSelectedCategory(newValue);
    setSelectedTags([]); // 切换分类时清空已选标签
  };

  // 处理标签选择
  const handleTagToggle = (tag: string) => {
    setSelectedTags(prev =>
      prev.includes(tag)
        ? prev.filter(t => t !== tag)
        : [...prev, tag]
    );
  };

  // 过滤角色
  const filteredCharacters = characters.filter(char => {
    const matchCategory = selectedCategory === 'all' || char.category === selectedCategory;
    const matchTags = selectedTags.length === 0 || selectedTags.some(tag => char.tags.includes(tag));
    return matchCategory && matchTags;
  });

  return (
    <Box>
      {/* 分类标签 */}
      <Tabs
        value={selectedCategory}
        onChange={handleCategoryChange}
        variant="scrollable"
        scrollButtons="auto"
        sx={{
          mb: 3,
          '& .MuiTab-root': {
            minWidth: 'auto',
            px: 3,
            py: 2,
            fontWeight: 600,
          },
          '& .Mui-selected': {
            color: 'primary.main',
          },
        }}
      >
        {categories.map(category => (
          <Tab
            key={category.id}
            label={category.label}
            value={category.id}
          />
        ))}
      </Tabs>

      {/* 标签筛选 */}
      <Box sx={{ mb: 4 }}>
        <Typography variant="subtitle1" sx={{ mb: 1, fontWeight: 600 }}>
          标签筛选
        </Typography>
        <Stack direction="row" spacing={1} flexWrap="wrap" useFlexGap>
          {allTags.map(tag => (
            <Chip
              key={tag}
              label={tag}
              onClick={() => handleTagToggle(tag)}
              color={selectedTags.includes(tag) ? 'primary' : 'default'}
              variant={selectedTags.includes(tag) ? 'filled' : 'outlined'}
              sx={{ 
                m: 0.5,
                '&.MuiChip-outlined': {
                  borderColor: 'rgba(0, 0, 0, 0.12)',
                },
              }}
            />
          ))}
        </Stack>
      </Box>

      <Typography variant="h4" gutterBottom>
        推荐角色
        {selectedCategory !== 'all' && ` · ${categories.find(c => c.id === selectedCategory)?.label}`}
      </Typography>

      <Grid container spacing={3}>
        {filteredCharacters.map((character) => (
          <Grid item xs={12} sm={6} md={4} key={character.id}>
            <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
              <CardMedia
                component="img"
                height="200"
                image={character.avatar}
                alt={character.name}
                sx={{ objectFit: 'cover' }}
              />
              <CardContent sx={{ flexGrow: 1 }}>
                <Typography gutterBottom variant="h5" component="div">
                  {character.name}
                </Typography>
                <Typography variant="body2" color="text.secondary" paragraph>
                  {character.description}
                </Typography>
                <Box sx={{ mb: 2 }}>
                  {character.tags.map((tag) => (
                    <Typography
                      key={tag}
                      component="span"
                      sx={{
                        mr: 1,
                        px: 1,
                        py: 0.5,
                        bgcolor: selectedTags.includes(tag) ? 'primary.light' : 'primary.lighter',
                        color: selectedTags.includes(tag) ? 'white' : 'primary.main',
                        borderRadius: 1,
                        fontSize: '0.75rem',
                        cursor: 'pointer',
                        transition: 'all 0.2s',
                        '&:hover': {
                          bgcolor: 'primary.light',
                          color: 'white',
                        },
                      }}
                      onClick={() => handleTagToggle(tag)}
                    >
                      {tag}
                    </Typography>
                  ))}
                </Box>
                <Button
                  component={Link}
                  to={`/chat/${character.id}`}
                  variant="contained"
                  fullWidth
                >
                  开始聊天
                </Button>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default Home;
